import React from 'react';
import TableTr from './TableTr';
import './api-services';

const Table = () => {

    return (
        <div>
            <TableTr/>
            <table id='employee'>
                <thead>
                    <tr>{renderHeader()}</tr>
                </thead>
                <tbody>
                    {renderBody()}
                </tbody>
            </table>
        </div>
    );
};

export default Table;
